void DL_update(int index, double runtime){
    if(DL_pos[index] == DL_WCET_index[index]){
        DL_buf[index][DL_pos[index]] = runtime;
        double maxn = 0;
        for(int i = 0; i < 5000; i++){
            if(i == DL_pos[index]) continue;
            if(DL_buf[index][i] > maxn){
                maxn = std::max(maxn, DL_buf[index][i]);
                DL_WCET_index[index] = i;
            }
        }
        DL_pos[index] = (DL_pos[index] + 1) % 5000;
    }
    else{
        DL_buf[index][DL_pos[index]] = runtime;
        if(DL_buf[index][DL_WCET_index[index]] < runtime){
            DL_WCET_index[index] = DL_pos[index];
        }
        DL_pos[index] = (DL_pos[index] + 1) % 5000;
    }
}
double find_DL_WCET(int index){
    return DL_buf[index][DL_WCET_index[index]];
}
